import React, { Fragment } from 'react';
import Footer from '../../Footer';
import Navigation from '../../Navigation';
import Direct from './Direct';

const Direct_page = () => {
    return(
        <Fragment>
            <Navigation />
            <Direct />
            <Footer />
        </Fragment>
    )
}

export default Direct_page
